import React ,{Component} from 'react';
class Navbar extends Component {
    render(){
      return (
        <nav>     
    <div id='parent-with-flex-direction-row'>
        <div id='logo'>
        VietTraveller
        </div>
        <div class='child'>
        <ul>
          <li>< a href='#'>Block1</a></li>
          <li><a href='#'>Block2</a></li>
          <li><a href='#'>Block3</a></li> 
        </ul>
        </div>
        <div id='account'>
        <a href='#'>Account</a>
        </div>     
    </div>
    </nav>);
  }
};

export default Navbar;
